    const datasetMap: Map<string, Dataset> = new Map<string, Dataset>();
    {
        const datasets = Object.values(Datasets)
                .filter((dataset): dataset is Dataset => typeof dataset === "object" && "datasetCode" in dataset); 
        for (const dataset of datasets) {
            datasetMap.set(dataset.datasetCode, dataset);
        }

    }

    export function fromCode(code: string): Dataset {
        const dataset = datasetMap.get(code);
        if (!dataset) {
            throw new Error(`Dataset with code ${code} not found`);
        };
        return dataset;
    }
